-- Dumping structure for procedure webdesktop_altersms.jurnal_buktikasdanbank
DELIMITER //
CREATE PROCEDURE `jurnal_buktikasdanbank`(IN `P_NOTRX` VARCHAR(50))
BEGIN
   SET @no:=0;
   SELECT 
		IF(C.jenistransaksi='BKM', 'Bukti Kas Masuk', 
		IF(C.jenistransaksi='BKK', 'Bukti Kas Keluar', 
		IF(C.jenistransaksi='BBM', 'Bukti Bank Masuk', 
		IF(C.jenistransaksi='BBK', 'Bukti Bank Keluar', '')))) AS judul,
		C.nobukti,
		C.tanggal,
		C.jenis,
		C.jumlah AS jumlah_header,
		C.subyek,
		C.rekeningheader,
		C.nama_akun AS nama_rekeningheader,
		C.keterangan AS keterangan_header,		
		@no:=@no+1 AS no, 
		IF(A.jenis='Debet', 'Kredit', 'Debet') AS judul_detaiil, 		
		IF(A.jenis='Debet', A.kk, A.kd) AS kode_akun, 
		B.nama_akun, 
		IF(A.jenis='Debet', A.ket2, A.ket) AS keterangan,
   	A.volume AS qty, 
		A.jumlah_a AS harga, 
		A.jumlah 
	FROM 
		jurnal_srb AS A LEFT JOIN 
		rekening AS B ON B.kode_akun=IF(A.jenis='Debet', A.kk, A.kd) LEFT JOIN 
		(SELECT 
            DISTINCT(A.nobukti) AS nobukti,
            DATE_FORMAT(A.tanggal, '%d-%m-%Y') AS tanggal,
            tipe_jurnal AS jenistransaksi,
            A.jenis,
            SUM(A.jumlah) AS jumlah,
            A.subyek,
            IF(A.jenis='Debet', A.kd, A.kk) AS rekeningheader,
            B.nama_akun,
            IF(A.jenis='Debet', A.ket, A.ket2) AS keterangan            
        FROM 
            jurnal_srb AS A LEFT JOIN rekening AS B ON B.kode_akun=IF(A.jenis='Debet', A.kd, A.kk)
        WHERE 
            A.nobukti=P_NOTRX 
        GROUP BY 
            nobukti) AS C ON C.nobukti=A.nobukti
   WHERE 
		A.nobukti=P_NOTRX;
   
END//
DELIMITER ;

