DELIMITER //
CREATE PROCEDURE `jurnal_memorial`(IN `P_NOTRX` VARCHAR(50))
BEGIN
	SET @no:=0;
	SELECT 
		A.nobukti,
		DATE_FORMAT(A.tanggal, '%d-%m-%Y') AS tanggal,
		A.keterangan,
		@no:=@no+1 AS no,
		B.coa,
		C.nama_akun,
		B.keterangan AS ket_detail,
		B.debet,
		B.kredit		
	FROM 
		jurnal AS A, jurnal_detail AS B 
		LEFT JOIN rekening AS C ON C.kode_akun=B.coa
	WHERE 
		A.nobukti=B.nobukti AND 
		A.nobukti=P_NOTRX 
	ORDER BY IF(B.debet>B.kredit, 0, 1);
END//
DELIMITER ;

