		CONCAT('Total pengajuan sd ', DATE_FORMAT(SUBDATE(DATE_FORMAT(P_FROM, '%Y-%m-%d'), INTERVAL 1 DAY), '%d-%m-%Y')) AS keterangan,	
		0 AS kredit,
		COALESCE(SUM(PA.jumlah), 0) AS debet, 
		@saldo:=@saldo-COALESCE(SUM(PA.jumlah), 0) AS saldo
	FROM 
		pengajuan_anggaran AS PA LEFT JOIN
		area AS AR ON AR.id=P_ID_DIVISI LEFT JOIN
		area AS PR ON PR.id=P_ID_PROYEK LEFT JOIN
		rekening_budget AS RB ON RB.id=P_ID_AKUN_BUDGET
	WHERE 
		PA.id_divisi=P_ID_DIVISI AND 
		PA.id_proyek=P_ID_PROYEK AND 
		PA.id_akunbudget=P_ID_AKUN_BUDGET AND
		PA.tanggal 
	BETWEEN 
		DATE_FORMAT(CONCAT(DATE_FORMAT(P_FROM, '%Y')-IF(DATE_FORMAT(P_FROM, '%m')<=10,1,0), '-11-01'), '%Y-%m-%d') AND
		DATE_FORMAT(SUBDATE(DATE_FORMAT(P_FROM, '%Y-%m-%d'), INTERVAL 1 DAY), '%Y-%m-%d'))
UNION ALL
(SELECT 
	AR.kode,
	AR.nama,
	PR.kode AS kode_pr,
	PR.nama AS nama_pr,
	RB.kode_akun,
	RB.nama_akun,
	DATE_FORMAT(P_FROM, '%d-%m-%Y') AS DARI,
	DATE_FORMAT(P_TO, '%d-%m-%Y') AS SAMPAI, 
	@no:=@no+1 AS nomer,
	DATE_FORMAT(tanggal, '%d-%m-%Y') AS tanggal,
	notrx AS no_bukti,
	keterangan,
	0 AS kredit,
	PA.jumlah AS debet,
	@saldo:=@saldo-PA.jumlah AS saldo
FROM  
	pengajuan_anggaran AS PA LEFT JOIN
	area AS AR ON AR.id=P_ID_DIVISI LEFT JOIN
	area AS PR ON PR.id=P_ID_PROYEK LEFT JOIN
	rekening_budget AS RB ON RB.id=P_ID_AKUN_BUDGET
WHERE 
	PA.id_divisi=P_ID_DIVISI AND 
	PA.id_proyek=P_ID_PROYEK AND 
	PA.id_akunbudget=P_ID_AKUN_BUDGET AND
	PA.tanggal BETWEEN P_FROM AND P_TO);
END//
